package Array;

public class MultidimenDionalArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a[][]= {
				{1,2,3},{2,3,4},{4,5,6},
		};
		for(int i=0;i<3;i++) {
			for(int j=0;j<3;j++) {
				System.out.print(a[i][j]+"\t");
			}
			System.out.println("\n");
		}
		
		
		

	}

}
